      END IF
      
      NSect = NSect + 1
      IF(PRESENT(dgc)) THEN
         ! Read dgc.
         CALL ReadToSection('apot.bin',SectionNumber = NSect)
         DO iph = 1, SIZE(dgc,3)
            CALL Read2D('apot.bin', dgc(:,:,iph), n1, n2, FileType = FileType)
         END DO
      END IF

      NSect = NSect + nph + 2
